プリウス ZVW35 PHV専用  <br>
耐熱フォグランプ後付けLEDキット<br>
<br>
■プリウス ZVW35 PHV専用  フォグ未装着車にフォグランプを後付け！<br>
プリウス ZVW35 PHV用　純正グリル付！<br>
必要な部品がすべて揃った、お手軽にフォグランプが取り付けれるキットです。<br>
出来る限りお安くお買い求め頂けるように…と考え、この商品が完成致しました。<br><br>

純正の専用ディマスイッチを取り付ける必要がなく簡単配線！<br>
ON/OFF専用スイッチは、純正オプションホールに装着簡単装着！<br>
見た目もすっきり！！<br>
詳しい取付説明書・配線図付きです。<br><br>

【適合車種】<br>
プリウス ZVW35 (H24.1～) フォグランプ未装着車用<br><br>

【キット内容】<br>
・トヨタ純正グリル　（シルバーとゴールドからお選び下さい。）<br>
・当店オリジナルフォグランプ左右一式　（オプション：純正品　＋20,000円）<br>
・LED（色温度 6000K）<br>
・専用ON/OFFスイッチ<br><br>
・専用ハーネス
・取付説明書＆配線図<br>
<br>
【ご注意】<br>
●当店でお取り付けも可能です。ご希望の場合はTEL：06-6858-8886までお問い合わせ下さい。 
<br>●こちらの商品は納期が2週間～かかります。在庫がある場合は即納。お急ぎの場合はご注文前に納期お問い合わせ下さい。 
<br>●現在の商品価格は発売記念価格となっております。今後変動する場合がございますのでご了承下さい。 
<br>●当キットによる車両故障や破損について、当店では一切の責任を負いかねますのでご了承下さい。 <br>●当キットは最良に仕様の変更がございますのでご了承ください。<br>







